Okay, let's think through this ultimatum game scenario and design a computational model to predict responder behavior.

**Psychological Mechanisms:**

1.  **Fairness Evaluation:** Responders assess the fairness of the offer. This involves comparing the offered amount to what they perceive as a fair or equitable share. This perception is influenced by several factors:
    *   **Contribution:** The responder's contribution (token\_self) relative to the opponent's contribution (token\_opp) will influence what they believe is a fair split. If the responder contributed more, they might expect a larger share.
    *   **Egalitarianism:** People may have a prior that the split should be roughly equal, and deviations from this expectation may influence acceptance. The 'combined\_earning' is also crucial here.
    *   **Offered Amount:** The absolute amount offered to the responder (`split_self`) is a key factor in their decision.

2.  **Inequity Aversion:** Responders may reject offers perceived as unfair, even if it means receiving nothing. This suggests a disutility associated with receiving less than what they consider fair.

3.  **Utility Calculation:** The responder weighs the utility of accepting the offer (receiving the proposed amount) against the disutility of rejecting the offer (receiving nothing, but also punishing the proposer for unfairness).

**Interaction of Mechanisms:**

The fairness evaluation acts as a reference point. The perceived unfairness (or fairness) of the offer influences the utility associated with accepting. Inequity aversion modulates the impact of unfairness on utility. The combined utility is then used to predict acceptance.

**Mathematical Form:**

I will use a utility-based model to predict acceptance, with a logistic function to map utility to a probability. I'll incorporate fairness and inequity aversion.

U = split_self - alpha * max(split_opp - split_self, 0) - beta * max(split_self - split_opp, 0) - gamma * abs(split_self - fairness)

fairness = combined_earning * (token_self/(token_self+token_opp))

*   `split_self`: The proposed amount to the responder.
*   `split_opp`: The proposed amount to the opponent.
*   `alpha`: Inequity aversion parameter representing the sensitivity to receiving less than the proposer.
*   `beta`: Guilt parameter representing the sensitivity to receiving more than the proposer.
*   `gamma`: Fairness parameter representing the sensativity to deviation from the ideal split.
*   `fairness`: This is the calculated fairness of the split, based on relative contribution. This will use combined earning to figure this out.

**Parameters:**

*   `alpha`: Inequity aversion (learnable).
*   `beta`: Guilt (learnable).
*   `gamma`: Fairness (learnable).

**Mapping to Observable Behavior:**

The calculated utility `U` is mapped to a probability of accepting the offer using a logistic function. Higher utility translates to a higher probability of acceptance. The `accept` variable is the observed behavior (0 or 1).

